import React, { useState, useEffect } from "react";
import {
  Container,
  TextField,
  Button,
  Typography,
  Box,
  Paper,
  Grid,
  ThemeProvider,
  createTheme,
  CssBaseline,
  IconButton,
  CircularProgress,
} from "@mui/material";
import Brightness4Icon from "@mui/icons-material/Brightness4";
import Brightness7Icon from "@mui/icons-material/Brightness7";
import axios from "axios";

const API_URL = "http://localhost:8000";

function App() {
  const [darkMode, setDarkMode] = useState(false);
  const [location, setLocation] = useState("");
  const [timeData, setTimeData] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");
  const [meetingLocations, setMeetingLocations] = useState([""]);
  const [meetingTime, setMeetingTime] = useState("");
  const [meetingResults, setMeetingResults] = useState([]);

  const theme = createTheme({
    palette: {
      mode: darkMode ? "dark" : "light",
    },
  });

  const handleTimeSearch = async () => {
    setLoading(true);
    setError("");
    try {
      const response = await axios.get(`${API_URL}/time/${location}`);
      setTimeData(response.data);
    } catch (err) {
      setError(
        'Location not found. Please try a valid timezone (e.g., "America/New_York")'
      );
    }
    setLoading(false);
  };

  const handleMeetingTime = async () => {
    setLoading(true);
    setError("");
    try {
      const response = await axios.post(`${API_URL}/meeting-times`, {
        locations: meetingLocations.filter((loc) => loc.trim() !== ""),
        meeting_time: meetingTime,
      });
      setMeetingResults(response.data);
    } catch (err) {
      setError("Error calculating meeting times. Please check your inputs.");
    }
    setLoading(false);
  };

  const addMeetingLocation = () => {
    setMeetingLocations([...meetingLocations, ""]);
  };

  const updateMeetingLocation = (index, value) => {
    const newLocations = [...meetingLocations];
    newLocations[index] = value;
    setMeetingLocations(newLocations);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Container maxWidth="md">
        <Box sx={{ my: 4 }}>
          <Box
            sx={{
              display: "flex",
              justifyContent: "space-between",
              alignItems: "center",
              mb: 4,
            }}
          >
            <Typography variant="h4" component="h1" gutterBottom>
              TimezoneBuddy
            </Typography>
            <IconButton onClick={() => setDarkMode(!darkMode)} color="inherit">
              {darkMode ? <Brightness7Icon /> : <Brightness4Icon />}
            </IconButton>
          </Box>

          <Paper sx={{ p: 3, mb: 4 }}>
            <Typography variant="h6" gutterBottom>
              Current Time Lookup
            </Typography>
            <Box sx={{ display: "flex", gap: 2, mb: 2 }}>
              <TextField
                fullWidth
                label="Enter timezone (e.g., America/New_York)"
                value={location}
                onChange={(e) => setLocation(e.target.value)}
                variant="outlined"
              />
              <Button
                variant="contained"
                onClick={handleTimeSearch}
                disabled={loading || !location}
              >
                Search
              </Button>
            </Box>
            {loading && <CircularProgress />}
            {error && <Typography color="error">{error}</Typography>}
            {timeData && (
              <Box sx={{ mt: 2 }}>
                <Typography>Timezone: {timeData.timezone}</Typography>
                <Typography>Current Time: {timeData.current_time}</Typography>
                <Typography>UTC Offset: {timeData.utc_offset}</Typography>
              </Box>
            )}
          </Paper>

          <Paper sx={{ p: 3 }}>
            <Typography variant="h6" gutterBottom>
              Meeting Time Calculator
            </Typography>
            <Box sx={{ mb: 2 }}>
              <TextField
                fullWidth
                type="datetime-local"
                label="Meeting Time"
                value={meetingTime}
                onChange={(e) => setMeetingTime(e.target.value)}
                InputLabelProps={{ shrink: true }}
                sx={{ mb: 2 }}
              />
              {meetingLocations.map((loc, index) => (
                <Box key={index} sx={{ display: "flex", gap: 2, mb: 1 }}>
                  <TextField
                    fullWidth
                    label={`Location ${index + 1}`}
                    value={loc}
                    onChange={(e) =>
                      updateMeetingLocation(index, e.target.value)
                    }
                    variant="outlined"
                  />
                </Box>
              ))}
              <Button
                variant="outlined"
                onClick={addMeetingLocation}
                sx={{ mt: 1 }}
              >
                Add Location
              </Button>
            </Box>
            <Button
              variant="contained"
              onClick={handleMeetingTime}
              disabled={
                loading ||
                !meetingTime ||
                meetingLocations.every((loc) => !loc.trim())
              }
            >
              Calculate Times
            </Button>
            {meetingResults.length > 0 && (
              <Box sx={{ mt: 3 }}>
                <Typography variant="h6" gutterBottom>
                  Meeting Times
                </Typography>
                <Grid container spacing={2}>
                  {meetingResults.map((result, index) => (
                    <Grid item xs={12} sm={6} key={index}>
                      <Paper sx={{ p: 2 }}>
                        <Typography variant="subtitle1">
                          {result.location}
                        </Typography>
                        <Typography>Local Time: {result.local_time}</Typography>
                        <Typography>UTC Offset: {result.utc_offset}</Typography>
                      </Paper>
                    </Grid>
                  ))}
                </Grid>
              </Box>
            )}
          </Paper>
        </Box>
      </Container>
    </ThemeProvider>
  );
}

export default App;
